package Day1;

public class helloWorld {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		for(int x=0; x<24; x++) {
			
			for(int y=0; y<60; y++) {
				if (y<10) {
					System.out.println(x+":0"+y);	
				}else {
					System.out.println(x+":"+y);
				}
		
		
			}}

	}

}
